<style>
:root{
  --bg:#07080b;
  --card:#0f1720;
  --muted:#9aa7b2;
  --accent1:#7c3aed;
  --accent2:#1fb6ff;
}
*{box-sizing:border-box}
body{margin:0;font-family:Inter,system-ui,Segoe UI,Roboto,Arial;background:linear-gradient(180deg,#040509,#06101a);color:#e6eef6}
.container{max-width:1100px;margin:28px auto;padding:18px}
.header{display:flex;align-items:center;gap:16px;margin-bottom:18px}
.logo-wrap{display:flex;align-items:center;gap:12px}
.logo-box img{width:56px;height:auto;border-radius:12px;box-shadow:0 0 25px rgba(124,58,237,.5)}
.title{font-size:22px;font-weight:700;letter-spacing:0.3px}
.subtitle{color:var(--muted);font-size:13px;margin-top:4px}
.card{background:var(--card);padding:14px;border-radius:12px;box-shadow:0 10px 30px rgba(2,6,12,.6)}
.list{display:grid;gap:10px}
.token{display:flex;flex-direction:column;gap:8px;padding:12px;border-radius:10px;background:linear-gradient(180deg,rgba(255,255,255,.02),transparent);cursor:pointer;transition:.15s}
.token:hover{transform:translateY(-3px);box-shadow:0 10px 25px rgba(8,10,15,.5)}
.token-head{display:flex;align-items:center;gap:12px}
.token img{width:44px;height:44px;border-radius:8px}
.tok-info{flex:1}
.tok-name{font-weight:700;font-size:15px}
.tok-meta{font-size:13px;color:var(--muted)}
.price{font-weight:800}
.spark{height:34px;width:140px}
.details{margin-top:8px;line-height:1.45;font-size:13px;background:#0b1620;padding:10px;border-radius:8px;color:#d8e6f2}
.muted{color:var(--muted)}
.empty{color:var(--muted);padding:28px;text-align:center}
</style>

        </div>
        <div>
          <div class="title">x402 Sniper</div>
          <div class="subtitle">Token explorer for the x402 ecosystem</div>
        </div>
      </div>
    </header>

    <main class="card">
      <div id="list" class="list">
        <div class="empty">Loading x402 tokensâ€¦</div>
      </div>
    </main>
  </div>

<script>
const API='https://api.coingecko.com/api/v3';
const listEl=document.getElementById('list');

function fmt(n){
  if(n==null)return'-';
  if(Math.abs(n)>=1e9)return(n/1e9).toFixed(2)+'b';
  if(Math.abs(n)>=1e6)return(n/1e6).toFixed(2)+'m';
  if(Math.abs(n)>=1e3)return(n/1e3).toFixed(1)+'k';
  return Number(n).toLocaleString();
}

async function getCategoryId(){
  try{
    const res=await fetch(`${API}/coins/categories`);
    if(res.ok){
      const cats=await res.json();
      const hit=cats.find(c=>(c.category_id||c.id||'').toLowerCase().includes('x402'));
      if(hit)return hit.category_id||hit.id;
    }
  }catch(_){}
  return'x402-ecosystem';
}

async function loadTokens(){
  listEl.innerHTML='<div class="empty">Loading x402 tokensâ€¦</div>';
  try{
    const cat=await getCategoryId();
    const res=await fetch(`${API}/coins/markets?vs_currency=usd&category=${encodeURIComponent(cat)}&per_page=250&page=1&sparkline=true`);
    if(!res.ok)throw new Error('API '+res.status);
    const data=await res.json();
    renderList(data);
  }catch(e){listEl.innerHTML=`<div class="empty">Error: ${e.message}</div>`;}
}

function renderList(items){
  if(!items?.length){listEl.innerHTML='<div class="empty">No tokens found.</div>';return;}
  listEl.innerHTML='';
  for(const it of items){
    const el=document.createElement('div');
    el.className='token';
    el.innerHTML=`
      <div class="token-head">
        <img src="${it.image||''}" alt="${it.id}" onerror="this.style.display='none'"/>
        <div class="tok-info">
          <div class="tok-name">${it.name} <span class="muted">(${(it.symbol||'').toUpperCase()})</span></div>
          <div class="tok-meta"><span class="price">${new Intl.NumberFormat('en-US',{style:'currency',currency:'USD'}).format(it.current_price??0)} </span>
            â€¢ MC: ${fmt(it.market_cap)} â€¢ 24h: ${it.price_change_percentage_24h?.toFixed(2)??'-'}%</div>
        </div>
        <canvas class="spark" data-spark='${JSON.stringify(it.sparkline_in_7d?.price||[])}'></canvas>
      </div>`;
    listEl.appendChild(el);
    drawSpark(el.querySelector('canvas'));
    el.addEventListener('click',()=>toggleDetail(el,it.id));
  }
}

function drawSpark(canvas){
  const arr=JSON.parse(canvas.getAttribute('data-spark')||'[]');
  const w=canvas.width=140,h=canvas.height=34;
  const ctx=canvas.getContext('2d');
  ctx.clearRect(0,0,w,h);
  if(!arr.length){ctx.fillStyle='rgba(255,255,255,0.02)';ctx.fillRect(0,0,w,h);return;}
  const min=Math.min(...arr),max=Math.max(...arr),range=(max-min)||1;
  ctx.beginPath();
  arr.forEach((v,i)=>{
    const x=(i/(arr.length-1))*w;
    const y=h-((v-min)/range)*h;
    if(i===0)ctx.moveTo(x,y);else ctx.lineTo(x,y);
  });
  ctx.lineWidth=1.5;ctx.strokeStyle='rgba(124,58,237,0.95)';ctx.stroke();
}

async function toggleDetail(el,id){
  const old=el.querySelector('.details');if(old){old.remove();return;}
  const div=document.createElement('div');div.className='details';div.textContent='Loading detailsâ€¦';el.appendChild(div);
  try{
    const res=await fetch(`${API}/coins/${encodeURIComponent(id)}?localization=false&tickers=false&market_data=true`);
    if(!res.ok)throw new Error('err');
    const d=await res.json();
    const homepage=(d.links?.homepage||[]).filter(Boolean).slice(0,2).map(u=>`<a href="${u}" target="_blank">${u}</a>`).join('<br>')||'â€”';
    const contracts=d.platforms?Object.entries(d.platforms).filter(([k,v])=>v).map(([k,v])=>`${k}: <code>${v}</code>`).join('<br>'):'â€”';
    const desc=(d.description?.en||'').split('. ').slice(0,2).join('. ')||'No description';
    div.innerHTML=`
      <div><strong>Price:</strong> ${new Intl.NumberFormat('en-US',{style:'currency',currency:'USD'}).format(d.market_data?.current_price?.usd ?? 0)} â€¢ <strong>Market Cap:</strong> $${fmt(d.market_data?.market_cap?.usd)}</div>
      <div style="margin-top:8px"><strong>Description:</strong> ${desc}</div>
      <div style="margin-top:8px"><strong>Links / Contracts:</strong><br>${homepage}<br>${contracts}</div>`;
  }catch{div.textContent='Error loading details.';}
}

loadTokens();
</script>
</body>
</html>
